import React,{useState} from 'react';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';

const Login = () => {
    const onChange = (event)=>{
        setCredantials ({...credantials,[event.target.name]:event.target.value})
    }
    const [credantials, setCredantials] = useState({email:"",password:""});

    const handleSubmit = async(e)=>{
        e.preventDefault(); // synthetic event read once
        const response = await fetch("http://localhost:5000/api/createuser",{
            method:'POST',
            headers: {
                'Content-Type':'application/json',
            },
            body:JSON.stringify({name:credantials.name, email:credantials.email,password:credantials.password,location:credantials.location})
        });
        const json = await response.json();
        console.log(json);
        if(!json.success){
            alert("Enter valid data!!");
        }
    }

    return (
    <div>
        <div><Navbar/></div>
        <div>
        <section class="max-height-100% mb-5" style={{backgroundColor: "dark"}}>
            <div class="container h-custom mt-5 text-dark rounded-3" style={{borderRadius:"25",backgroundColor:"#A1DD70"}}>
                <div class="row d-flex justify-content-center align-items-center h-100">
                <div class="col-md-9 col-lg-6 col-xl-5">
                    <img src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-login-form/draw2.webp" class="img-fluid" alt="Sample"/>
                </div>
                <div class="col-md-8 col-lg-6 col-xl-4 offset-xl-1">
                    <form>
                    <div class="d-flex flex-row align-items-center justify-content-center justify-content-lg-center mt-3" style={{opacity: "0.8"}}>
                        <p class="lead fw-normal mb-0 me-3">New User..??</p><br/>
                        <button type="button" data-mdb-button-init data-mdb-ripple-init class="btn btn-primary btn-m rounded-pill" style={{width:"wrap-content",backgroundColor:"#416D19",color:"white"}}>Register!!</button>    
                    </div>
                    

                    <div class="divider d-flex align-items-center justify-content-center my-4">
                        <p class="text-center fw-bold mx-3 mb-0">Or</p>
                    </div>
                    

                    <div data-mdb-input-init class="form-outline mb-4">
                        <input type="email" id="form3Example3" class="form-control form-control-lg"  style={{backgroundColor:"#416D19",color:"white"}} />
                        <label class="form-label" for="form3Example3">Email address</label>
                    </div>

                    <div data-mdb-input-init class="form-outline mb-3">
                        <input type="password" id="form3Example4" class="form-control form-control-lg"  style={{backgroundColor:"#416D19",color:"white"}} />
                        <label class="form-label" for="form3Example4">Password</label>
                    </div>

                    <div class="d-flex justify-content-between align-items-center">
                        
                        <div class="form-check mb-0">
                        <input class="form-check-input me-2" type="checkbox" value="" id="form2Example3" />
                        <label class="form-check-label" for="form2Example3">
                            Remember me
                        </label>
                        </div>
                        <a href="#!" class="text text-body text-dark" style={{textDecoration:"none" ,color:"black"}}>Forgot password?</a>
                    </div>

                    <div class="text-center text-lg-start mt-4 pt-2 pb-3">
                        <button  type="button" data-mdb-button-init data-mdb-ripple-init class="btn btn-primary btn-lg" style={{paddingLeft:"2.5rem",paddingRight:"2.5rem",backgroundColor:"#416D19",color:"white"}}>Login</button>
                    </div>

                    </form>
                </div>
                </div>
            </div>
            </section>
        </div>
        <div><Footer/></div>
    </div>
    );
}


export default Login;
